import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <header>
      <nav>
        <ul>
          <li><Link to="/">{t('Home')}</Link></li>
          <li><Link to="/lessons">{t('Lessons')}</Link></li>
          <li><Link to="/community">{t('Community')}</Link></li>
          <li><Link to="/culture">{t('Culture')}</Link></li>
          <li><Link to="/account">{t('Account')}</Link></li>
          <li><Link to="/contact">{t('Contact Us')}</Link></li>
        </ul>
      </nav>
    </header>
  );
}

export default Navbar;
